import logo from './logo.svg';
import './App.css';
import React ,{ useState } from 'react'

const Input = (initialValue) => {
    const [value, setValue] = useState(initialValue);
    return { value }
}

function App() {
    name = Input('Mr.');
    return (
        <>
            <h1>Hello</h1>
            <input placeholder={'Name'} {...name} />
        </>
    );
}

export default App;
